import React from 'react';
import web from "../src/image/about-1.jpg";

import Common from './common';

const Home = () => {
  return (<>
  <Common 
  name='Grow your business with' // these are properties of common.jsx
  imgscr={web}
   visit="/contact"
    btname='Get started'/>
    <img src="{web}" class="img-fluid" alt="Responsive image"></img>
    </>)

}
export default Home;
